using AEAssist;
using AEAssist.CombatRoutine.Trigger;
using AEAssist.CombatRoutine.Trigger.Node;
using AEAssist.Extension;
using AEAssist.Helper;
using AEAssist.MemoryApi;
using Dalamud.Game.ClientState.Objects.Types;

namespace BoxingBunny.Triggers;

public class TriggerCondition_M4S_3999 : ITriggerScript
{ 
    public bool Check(ScriptEnv scriptEnv, ITriggerCondParams condParams)
    {
        var targetlist = PartyHelper.CastableAlliesWithin30
            .Where(r => r.CurrentHp > 0 && r.HasAura(3999))
            .ToList();
        if (!targetlist.Any()) return false;

        var shortBuffGroup = new List<IBattleChara>();  
        var longBuffGroup = new List<IBattleChara>();  
        foreach (var target in targetlist)
        {
            var longbuff =  Core.Resolve<MemApiBuff>().GetAuraTimeleft(target,3999,false) > 30000;
            if (!longbuff)
            {
                shortBuffGroup.Add(target);  
            }
            else
            {
                longBuffGroup.Add(target);  
            }
        }

        scriptEnv.KV["短buff组"] = shortBuffGroup;
        scriptEnv.KV["长buff组"] = longBuffGroup;

        LogHelper.Print($"短buff组: {string.Join(", ", shortBuffGroup.Select(x => x.Name))}");
        LogHelper.Print($"长buff组: {string.Join(", ", longBuffGroup.Select(x => x.Name))}");

        var myGroup = shortBuffGroup.Contains(Core.Me) ? "短buff组" : 
            longBuffGroup.Contains(Core.Me) ? "长buff组" : "未获取到buff";

        scriptEnv.KV["自己所属组"] = myGroup;

        LogHelper.Print($"你属于：{myGroup}");

        return true; 
    }
}

