using AEAssist;
using AEAssist.CombatRoutine.Trigger;
using AEAssist.CombatRoutine.Trigger.Node;
using Dalamud.Game.ClientState.Objects.Types;
using AEAssist.MemoryApi;

namespace BoxingBunny.Triggers;

public class TriggerSript_M4S_3999remove : ITriggerScript
{ 
    public bool Check(ScriptEnv scriptEnv, ITriggerCondParams condParams)
    {
        var shortBuffGroup = scriptEnv.KV["短buff组"] as List<IBattleChara>;
        if (shortBuffGroup == null || !shortBuffGroup.Any()) return false;
        var removedBuffCount = 0;
        var groupSize = shortBuffGroup.Count;  
        foreach (var target in shortBuffGroup)
        {
            var bufftime = Core.Resolve<MemApiBuff>().GetAuraTimeleft(target, 3999, false);
            if (bufftime <= 0)
            {
                removedBuffCount++; 
            }

            if (removedBuffCount >= groupSize)
            {
                return true;
            }
        }
        return false; 
    }
}

